export function getZeroStats() {
  let allStats = new AllStats();
  return allStats.z[1];
}

export function getStats(a, b, c, d, e, f, g, ib, ts) {
  let allStats = new AllStats();
  let statsOut = allStats.z[0];

  Object.keys(allStats.a[a].STAT).map((key) => (statsOut.STAT[key] += allStats.a[a].STAT[key]));
  Object.keys(allStats.a[a].ELMT).map((key) => (statsOut.ELMT[key] += allStats.a[a].ELMT[key]));
  Object.keys(allStats.a[a].TRNG).map((key) => (statsOut.TRNG[key] += allStats.a[a].TRNG[key]));
  Object.keys(allStats.a[a].GEAR).map((key) => (statsOut.GEAR[key] += allStats.a[a].GEAR[key]));
  Object.keys(allStats.a[a].BODY).map((key) => (statsOut.BODY[key] += allStats.a[a].BODY[key]));

  Object.keys(allStats.b[b].STAT).map((key) => (statsOut.STAT[key] += allStats.b[b].STAT[key]));
  Object.keys(allStats.b[b].ELMT).map((key) => (statsOut.ELMT[key] += allStats.b[b].ELMT[key]));
  Object.keys(allStats.b[b].TRNG).map((key) => (statsOut.TRNG[key] += allStats.b[b].TRNG[key]));
  Object.keys(allStats.b[b].GEAR).map((key) => (statsOut.GEAR[key] += allStats.b[b].GEAR[key]));
  Object.keys(allStats.b[b].BODY).map((key) => (statsOut.BODY[key] += allStats.b[b].BODY[key]));

  Object.keys(allStats.c[c].STAT).map((key) => (statsOut.STAT[key] += allStats.c[c].STAT[key]));
  Object.keys(allStats.c[c].ELMT).map((key) => (statsOut.ELMT[key] += allStats.c[c].ELMT[key]));
  Object.keys(allStats.c[c].TRNG).map((key) => (statsOut.TRNG[key] += allStats.c[c].TRNG[key]));
  Object.keys(allStats.c[c].GEAR).map((key) => (statsOut.GEAR[key] += allStats.c[c].GEAR[key]));
  Object.keys(allStats.c[c].BODY).map((key) => (statsOut.BODY[key] += allStats.c[c].BODY[key]));

  Object.keys(allStats.d[d].STAT).map((key) => (statsOut.STAT[key] += allStats.d[d].STAT[key]));
  Object.keys(allStats.d[d].ELMT).map((key) => (statsOut.ELMT[key] += allStats.d[d].ELMT[key]));
  Object.keys(allStats.d[d].TRNG).map((key) => (statsOut.TRNG[key] += allStats.d[d].TRNG[key]));
  Object.keys(allStats.d[d].GEAR).map((key) => (statsOut.GEAR[key] += allStats.d[d].GEAR[key]));
  Object.keys(allStats.d[d].BODY).map((key) => (statsOut.BODY[key] += allStats.d[d].BODY[key]));

  Object.keys(allStats.e[e].STAT).map((key) => (statsOut.STAT[key] += allStats.e[e].STAT[key]));
  Object.keys(allStats.e[e].ELMT).map((key) => (statsOut.ELMT[key] += allStats.e[e].ELMT[key]));
  Object.keys(allStats.e[e].TRNG).map((key) => (statsOut.TRNG[key] += allStats.e[e].TRNG[key]));
  Object.keys(allStats.e[e].GEAR).map((key) => (statsOut.GEAR[key] += allStats.e[e].GEAR[key]));
  Object.keys(allStats.e[e].BODY).map((key) => (statsOut.BODY[key] += allStats.e[e].BODY[key]));

  Object.keys(allStats.f[f].STAT).map((key) => (statsOut.STAT[key] += allStats.f[f].STAT[key]));
  Object.keys(allStats.f[f].ELMT).map((key) => (statsOut.ELMT[key] += allStats.f[f].ELMT[key]));
  Object.keys(allStats.f[f].TRNG).map((key) => (statsOut.TRNG[key] += allStats.f[f].TRNG[key]));
  Object.keys(allStats.f[f].GEAR).map((key) => (statsOut.GEAR[key] += allStats.f[f].GEAR[key]));
  Object.keys(allStats.f[f].BODY).map((key) => (statsOut.BODY[key] += allStats.f[f].BODY[key]));

  for (let i = 0; i < ib.length; i++) {
    Object.keys(ib[i].STAT).map((key) => (statsOut.STAT[key] += ib[i].STAT[key]));
    Object.keys(ib[i].ELMT).map((key) => (statsOut.ELMT[key] += ib[i].ELMT[key]));
    Object.keys(ib[i].TRNG).map((key) => (statsOut.TRNG[key] += ib[i].TRNG[key]));
    Object.keys(ib[i].BODY).map((key) => (statsOut.BODY[key] += ib[i].BODY[key]));
  }

  Object.keys(allStats.ts[ts].STAT).map((key) => (statsOut.STAT[key] += allStats.ts[ts].STAT[key]));
  Object.keys(allStats.ts[ts].ELMT).map((key) => (statsOut.ELMT[key] += allStats.ts[ts].ELMT[key]));
  Object.keys(allStats.ts[ts].TRNG).map((key) => (statsOut.TRNG[key] += allStats.ts[ts].TRNG[key]));
  Object.keys(allStats.ts[ts].BODY).map((key) => (statsOut.BODY[key] += allStats.ts[ts].BODY[key]));

  let totalMass = 0;
  for (let i = 0; i < g.length; i++) {
    Object.keys(g[i].STAT).map((key) => (statsOut.STAT[key] += g[i].STAT[key]));
    Object.keys(g[i].ELMT).map((key) => (statsOut.ELMT[key] += g[i].ELMT[key]));
    Object.keys(g[i].TRNG).map((key) => (statsOut.TRNG[key] += g[i].TRNG[key]));
    totalMass = totalMass + g[i].GEAR.mass;
  }


  if (totalMass > statsOut.STAT.str) { statsOut.STAT.spd = statsOut.STAT.spd + statsOut.STAT.str - totalMass }
  return statsOut;
}

export function incrementStat(statblock, message) {
  if (message.hasOwnProperty('type')) {
    statblock[message.type][message.stat] = statblock[message.type][message.stat] + 1;
  }
  return statblock;
}

export function getSecondaryStats(statblock, gear) {

  let hands = statblock.BODY.Arms;
  let gearArmour = 0;
  for (let i = 0; i < gear.length; i++) {
    if (gear[i].GEAR.armour > gearArmour) { gearArmour = gear[i].GEAR.armour; }
    if (gear[i].GEAR.haft > 0 && hands > 0) { hands--; }
  }

  let ap = 1 + Math.max(
    statblock.STAT.str,
    statblock.STAT.con,
    statblock.STAT.dex,
    statblock.STAT.agi,
    statblock.STAT.spd,
    statblock.STAT.per,
    statblock.STAT.int,
    statblock.STAT.wis,
    statblock.STAT.cha,
    statblock.STAT.wpr,
  );

  let strik = Math.max(0, statblock.STAT.con) + Math.max(0, statblock.STAT.agi) + Math.max(0, statblock.STAT.wis) + gearArmour;
  let affli = Math.max(0, statblock.STAT.str) + Math.max(0, statblock.STAT.con) + Math.max(0, statblock.STAT.agi) + gearArmour;
  let influ = Math.max(0, statblock.STAT.int) + Math.max(0, statblock.STAT.wis) + Math.max(0, statblock.STAT.cha) + Math.max(0, statblock.TRNG.diplomacy);
  let conce = Math.max(0, statblock.STAT.per) + Math.max(0, statblock.STAT.int) + Math.max(0, statblock.STAT.wis) + Math.max(0, statblock.TRNG.subterfuge);
  let chase = Math.max(0, statblock.STAT.dex) + Math.max(0, statblock.STAT.agi) + Math.max(0, statblock.STAT.spd) + Math.max(0, statblock.TRNG.athletics);
  let restr = Math.max(0, statblock.STAT.str) + Math.max(0, statblock.STAT.con) + Math.max(0, statblock.STAT.int) + Math.max(0, statblock.TRNG.fighting) + hands * 2;

  let defs = {
    strike: strik,
    afflict: affli,
    influence: influ,
    conceal: conce,
    chase: chase,
    restrain: restr,
  }

  let body = {
    hands: hands, AP: ap
  }

  return { DEFS: defs, BODY: body };

}

export function getStatInteraction(stat1, stat2) {
  return Math.floor(Math.max(0, stat2) * Math.max(0, Math.pow(Math.max(0, stat1), 0.65)));
}

